import React from "react";
import Header from "./components/Header";
import Hero from "components/Hero";
import PropertyTypes from "components/PropertyTypes";
import SampleOMs from "components/SampleOMs";

const App: React.FC = () => {
  return (
    <div className="flex overflow-hidden flex-col justify-center bg-white">
      <Header logoSrc="https://cdn.builder.io/api/v1/image/assets/TEMP/f99e3214613e86250718ad2ff42b9e4ccab52c20b2f9005efaabacd8583b8301?placeholderIfAbsent=true&apiKey=eaed1ddc95b0480bae09257e9297624a" />

      <main>
        <Hero />

        <PropertyTypes />

        <SampleOMs />
      </main>
    </div>
  );
};
